export default function Hero1() {
  const [swiper, setSwiper] = useState(null);
  const [swiperIndex, setSwiperIndex] = useState(0);
  const {data} = useContext(MainContext)
  if(!data){
    console.log("no data")
  }
  return ( 
        
        <div
          className="hero1 grid object-cover bg-no-repeat bg-center grid-cols-2 h-screen w-screen relative"
          style={{
            backgroundImage: `url(${data[swiperIndex].url})`,
          }}
        >            
          <div className="col-span-1 self-center">
            <p className="text-7xl text-white">Welcome to India</p>
            <p className="p-8 text-gray-300">
              India, officially the Republic of India (Hindi: Bhārat Gaṇarājya),[25]
              is a country in South Asia. It is the seventh-largest country by area,
              the second-most populous country, and the most populous democracy in
              the world. Bounded by the Indian Ocean on the south, the Arabian Sea
              on the southwest, and the Bay of Bengal on the southeast, it shares
              land borders with Pakistan to the west;[f] China, Nepal, and Bhutan to
              the north; and Bangladesh and Myanmar to the east. In the Indian
              Ocean, India is in the vicinity of Sri Lanka and the Maldives; its
              Andaman and Nicobar Islands share a maritime border with Thailand,
              Myanmar, and Indonesia.
            </p>
            <button className="border rounded-lg text-white bg-slate-400 px-4 py-2 hover:bg-slate-500 active:bg-slate-600">
              Explore
            </button>
          </div>
          <div className="self-end">
            {/* refresh this component on each swipe... */}
            <Comp swiperIndex={swiperIndex} />
            <Swiper
              className="h-72 my-4 mx-2 w-full self-end rounded-lg"
              // install Swiper modules
              modules={[Navigation, Pagination, Scrollbar, A11y]}
              spaceBetween={25}
              slidesPerView={3.5}
              navigation
              pagination={{ clickable: true }}
              scrollbar={{ draggable: true }}
              onSwiper={setSwiper}
              slideToClickedSlide={true}
              onSlideChange={() => setSwiperIndex(swiper.activeIndex)}
            >
              {data.map((ele, index) => (
                <SwiperSlide className="relative">
                  <img
                    key={index}
                    alt={ele.city}
                    src={ele.url}
                    className="object-cover rounded-lg h-full w-full"
                  ></img>
                  <div className="bottom-left flex flex-col h-20 p-2">
                    <p class="text-white text-4xl">{ele.city}</p>
                    {/* <p class="text-white truncate">{ele.description}</p> */}
                  </div>
                </SwiperSlide>
              ))}
            </Swiper>
          </div>
        </div>
  );
}

function Comp({ swiperIndex }) {
  const {data} = useContext(MainContext);

  return (
    <p className="w-10 h-10 text-right animate-fade-in-up text-white text-4xl">
      {data[swiperIndex].city}
    </p>
  );
}
